import { AppBar, Toolbar, Typography } from '@mui/material'
import React, { useEffect, useRef } from 'react'
import LibraryBooksIcon from '@mui/icons-material/LibraryBooks';
import { Box } from '@mui/system';

const MainPage = () => {
    var searchInp = useRef('');

   useEffect(()=>{
    if(searchInp.current){
        searchInp.current.focus();
    }
    fetch('')
   })
   const submit=(e)=>{
    e.preventDefault()
    console.log(searchInp.current.value)
   }

  return (
    <React.Fragment>
        <AppBar>
            <Toolbar>
                <LibraryBooksIcon/>
                <Typography variant='h4'>Library App</Typography>
            </Toolbar>            
        </AppBar>
        <Box className='search_div'>
            <form onSubmit={submit}>
                <input className='search_inp' ref={searchInp}/>
                <button  style={{display:'none'}} type='submit'/>
            </form> 
        </Box>
    </React.Fragment>
  )
}

export default MainPage
